        - field_footnotes_vic5
      parent_name: ''
      weight: 268
      format_type: tab
      format_settings:
        formatter: closed
        description: '<h3>VI.C.(5). TEN OLDEST PENDING ADMINISTRATIVE APPEALS</h3>Only those components that process administrative appeals should be entered in this section. If a component or the agency overall does not have ten or more appeals pending as of the end of the fiscal year, complete the excess cells by listing "N/A" for the "Date of Appeal" and "0" for the "Number of Days Pending." If a date is filled in, the number of days associated with the date must also be filled in. "Number of Days Pending" values must be non-negative integers. Working day calculations should include only working days (excluding weekends and public holidays) as of the end of the fiscal year (i.e., September 30). There are working day calculators that may be helpful in calculating these dates. To add a component click "Add" above the "Agency Overall" fields. The "Agency Overall" fields must be manually entered, they are not autocalculated.\r\n\r\nIn the date field enter the date the appeal was received.'
        required_fields: true
        id: ''
        classes: ''
      label: 'VI.C.(5). TEN OLDEST PENDING ADMINISTRATIVE APPEALS'
      region: hidden
    group_vii_a_foia_requests_wrap:
      children:
        - field_footnotes_viia
        - field_proc_req_viia
      parent_name: ''
      weight: 269
      format_type: tab
      format_settings:
        formatter: closed
        description: "<h3>VII.A. FOIA REQUESTS -- RESPONSE TIME FOR ALL PROCESSED PERFECTED REQUESTS</h3><p>Every component that  processes requests should be listed, even if they do not have data to report in this section. If the component field is filled in, all other editable fields must be filled in. Enter “N/A” for Median, Average, Lowest or Highest Number of Days if there are no requests for that track. Values must either be non-negative numeric values, the special value \"<1\", or the special value \"N/A\". To add a component click \"Add\" above the \"Agency Overall\" fields. The \"Agency Overall\" fields must be manually entered, they are not autocalculated.</p>\r\n<p>Only processed perfected requests should be included in this section. Requests with dispositions \"Not Reasonably Described\" and \"Improper\" should not be included in this section.</p>"
        required_fields: true
        id: ''
        classes: ''
      label: 'VII.A. FOIA REQUESTS -- RESPONSE TIME FOR ALL PROCESSED PERFECTED REQUESTS'
      region: hidden
    group_vii_b_processed_req_wrap:
      children:
        - field_footnotes_viib
        - field_proc_req_viib
      parent_name: ''
      weight: 270
      format_type: tab
      format_settings:
        formatter: closed
        description: "<h3>VII.B. PROCESSED REQUESTS -- RESPONSE TIME FOR PERFECTED REQUESTS IN WHICH INFORMATION WAS GRANTED</h3><p>Every component that  processes requests should be listed, even if they do not have data to report in this section. If the component field is filled in, all other editable fields must be filled in. Values must either be non-negative numeric values, the special value \"<1\", or the special value \"N/A\". Enter “N/A” for Median, Average, Lowest or Highest Number of Days if there are no requests for that track. To add a component click \"Add\" above the \"Agency Overall\" fields. The \"Agency Overall\" fields must be manually entered, they are not autocalculated.</p>\r\n<p>Only processed perfected requests should be included in this section. Requests with dispositions \"Not Reasonably Described\" and \"Improper\" should not be included in this section.</p>"
        required_fields: true
        id: ''
        classes: ''
      label: 'VII.B. PROCESSED REQUESTS -- RESPONSE TIME FOR PERFECTED REQUESTS IN WHICH INFORMATION WAS GRANTED'
      region: hidden
    group_vii_d_pending_req_wrap:
      children:
        - field_footnotes_viid
        - field_pending_requests_vii_d_
      parent_name: ''
      weight: 271
      format_type: tab
      format_settings:
        formatter: closed
        description: '<h3>VII.D. PENDING REQUESTS -- ALL PENDING PERFECTED REQUESTS</h3>Every component that  processes requests should be listed, even if they do not have data to report in this section. If the component field is filled in, all other editable fields must be filled in. "Number Pending" fields must contain non-negative integer, or the special value "N/A". "Median" and "Average" fields must contain non-negative decimal numbers, or the special value "N/A". If there are no pending requests for a track, enter “0” for number pending and “N/A” for Median and Average Number of Days. To add a component click "Add" above the "Agency Overall" fields. The "Agency Overall" fields must be manually entered, they are not autocalculated.'
        required_fields: true
        id: ''
        classes: ''
      label: 'VII.D. PENDING REQUESTS -- ALL PENDING PERFECTED REQUESTS'
