      weight: 272
      format_type: tab
      format_settings:
        formatter: closed
        description: '<h3>VII.E. PENDING REQUESTS -- TEN OLDEST PENDING PERFECTED REQUESTS</h3>Every component that  processes requests should be listed, even if they do not have data to report in this section. If there are no pending perfected requests for a component, enter “N/A” for Date of Receipt and “0” for Days Pending. If a date is filled in, the number of days associated with the date must also be filled in. "Number of Days Pending" values must be non-negative integers.Working day calculations should include only working days (excluding weekends and public holidays) as of the end of the fiscal year (i.e., September 30). There are working day calculators that may be helpful in calculating these dates. To add a component click "Add" above the "Agency Overall" fields. The "Agency Overall" fields must be manually entered, they are not autocalculated.'
        required_fields: true
        id: ''
        classes: ''
      label: 'VII.E. PENDING REQUESTS -- TEN OLDEST PENDING PERFECTED REQUESTS'
