      weight: 274
      format_type: tab
      format_settings:
        id: ''
        classes: ''
        formatter: closed
        description: '<h3>IX. FOIA Personnel and Costs</h3>Every component that  processes requests or appeals should be listed, even if they do not have data to report in this section. If the component processed requests in V.A. there must be a value entered for personnel and costs. If the component field is filled in, all other editable columns must be filled in. All values must be non-negative numeric integers. To add a component click "Add" above the "Agency Overall" fields. The "Agency Overall" and "Total" field(s) will be autocalculated as you enter data in this section.'
        required_fields: true
      label: 'IX. FOIA Personnel and Costs'
      region: hidden
    group_xii_c_consultations_wrap:
      children:
