        - field_footnotes_xiic
      parent_name: ''
      weight: 275
      format_type: tab
      format_settings:
        formatter: closed
        description: '<h3>XII.C. CONSULTATIONS ON FOIA REQUESTS -- TEN OLDEST CONSULTATIONS RECEIVED FROM OTHER AGENCIES AND PENDING AT THE AGENCY</h3>A component, or the agency overall, may not have ten consultations pending. Thus, some columns may be not applicable. If there are no pending consultations for a component, enter “N/A” for Date of Receipt and “0” for Days Pending. If a date is filled in, the number of days associated with the date must also be filled in. "Number of Days" values must be non-negative integers. "Number of Days Pending" values must be non-negative integers. Working day calculations should include only working days (excluding weekends and public holidays) as of the end of the fiscal year (i.e., September 30). There are working day calculators that may be helpful in calculating these dates. To add a component click "Add" above the "Agency Overall" fields. The "Agency Overall" fields must be manually entered, they are not autocalculated.'
        required_fields: true
        id: ''
        classes: ''
      label: 'XII.C. CONSULTATIONS ON FOIA REQUESTS -- TEN OLDEST CONSULTATIONS RECEIVED FROM OTHER AGENCIES AND PENDING AT THE AGENCY'
      region: hidden
    group_xii_d_1_comparison_wrap:
      children:
        - field_foia_xiid1
        - field_footnotes_xiid1
      parent_name: ''
      weight: 276
      format_type: tab
      format_settings:
        id: ''
        classes: ''
        formatter: closed
        description: '<h3>XII.D.(1). COMPARISON OF NUMBERS OF REQUESTS FROM PREVIOUS AND CURRENT ANNUAL REPORT -- REQUESTS RECEIVED AND PROCESSED</h3>If the component field is filled in, all other editable columns must be filled in. All values must be non-negative integers. The values entered for the current fiscal year must match those entered on tab V.A. To add a component click "Add" above the "Agency Overall" fields. The "Agency Overall" field(s) will be autocalculated as you enter data in this section.'
        required_fields: true
      label: 'XII.D.(1). COMPARISON OF NUMBERS OF REQUESTS FROM PREVIOUS AND CURRENT ANNUAL REPORT -- REQUESTS RECEIVED AND PROCESSED'
      region: hidden
    group_xii_e_1_comparison_of_wrap:
